import React, { Component } from "react";
class UserContainerForm extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      age: "",
    };
  }
  render() {
    const { name, age } = this.state;
    return (
      <div>
        <form action="/UserContainer.js" onSubmit={this.submitHandler}>
          <div>
            <label>Name:</label>
            <input
              type="text"
              name="name"
              value={name}
              onChange={this.changeHandler}
            />
          </div>
          <div>
            <label>Age:</label>
            <input
              type="text"
              name="age"
              value={age}
              onChange={this.changeHandler}
            />
          </div>
          <button type="submit">Submit</button>
        </form>
      </div>
    );
  }
}

export default UserContainerForm;
